The DOM (Document Object Model) is a representation of the structure of an html document. The DOM models a document as a tree, with elements in parent-child relationships. DOM Tree DOM API contains no support for encapsulation. This makes it hard to develop custom elements Style information may leak into or out of other elements in the tree IDs may overlap between custom elements and other elements in the document. Shadow DOM allows us to attach encapsulated DOM subtrees to elements in a web document. Style information inside them cannot apply to outside elements, and vice versa. const header = document.createElement('header');
const shadowRoot = header.attachShadow({mode: 'open'});
shadowRoot.innerHTML = `<h1>Hello Shadow DOM</h1>`; Shadow DOM Example By default, if an element has shadow DOM, the shadow tree is rendered instead of the element's children. To allow children to render, you need to add placeholders for them in your shadow tree. To do this in shadow DOM: <!-- shadow tree for <my-header> -->
<header> <h1><slot></slot></h1> <button>Menu</button>
</header> <my-header>Shadow DOM</my-header> The header renders as if the element was replaced by the children: <my-header> <header> <h1>Shadow DOM</h1> <button>Menu</button> </header>
</my-header> Each LWC has a shadow DOM tree attached

